Synopsis 
Moscou, de nos jours. Dans une cage descalier dun immeuble ordinaire, une jeune femme est assassinee de sang-froid, mais on ne releve aucune trace de violence sur son corps.
On decouvre assez rapidement que cette femme etait une :Autre de lOmbre: et quelle etait membre de Day Watch, une organisation secrete dirigee par un sombre et puissant sorcier denomme Zavoulon. La treve fragile, quavaient conclue la Lumiere et lOmbre et qui sest maintenue pendant des siecles, est brisee - les :Autres de la Lumiere: etant les principaux suspects.
Guesser, le commandant de Night Watch, rassemble immediatement ses troupes, un meurtre etant un evenement grave et ses consequences pouvant conduire a une guerre ouverte entre les forces de la Lumiere et celles de lOmbre. Night Watch doit reagir, mais Guesser doit prealablement decouvrir ou chacun des :Autres de la Lumiere: se trouvait au moment du meurtre. Il savere que seul Anton Gorodetski na pas dalibi a fournir...Anton continue de combattre les forces du mal. Alors quil tente de retrouver son fils, une nouvelle menace, plus terrifiante encore que ses combats passees, se fait jour... 
